DROP FUNCTION IF EXISTS choose_genre//
CREATE FUNCTION choose_genre ()
RETURNS CHAR(18) DETERMINISTIC
BEGIN
	RETURN ELT(CEIL(RAND() * 40), 'art','action','martial arts','vampires','harem','gender intrigue','heroic fantasy','detective','jsei','drama','game','isekai','history','cyberpunk','kodomo','comedy','maho-shojo','mecha','mysticism','science fiction','everyday life','post-apocalyptic','adventure','psychology','romance','samurai','supernatural','sport','seinen','shjo','shnen','thriller','shn-ai','tragedy','horror','fantasy','school','erotica',' etti','yuri');
END //

DROP FUNCTION IF EXISTS choose_tag//
CREATE FUNCTION choose_tag ()
RETURNS CHAR(29) DETERMINISTIC
BEGIN
	RETURN ELT(CEIL(RAND() * 39), 'gambling','alchemy','amnesia','angels','anti-hero','war','magicians','magical creatures','memories from another world','MC woman','MC imba','MC man','gamers','guilds','stupid MC','time travel','sentient races','power ranks','reincarnation','robots','knights','samurai','system','identity hiding','saving the world','sports body','middle ages','steampunk','superheroes','traditional games','smart MC',' teacher','philosophy','hikigomori','edged weapons','blackmail','elves','yakuza','japan');
