CREATE FUNCTION choose_format ()
RETURNS CHAR(9) DETERMINISTIC
BEGIN
	RETURN ELT(CEIL(RAND() * 6), 'Enkoma','Dodzinsi','Single','Colorful','Kit','Web');
END //

DROP PROCEDURE IF EXISTS fill_genres//
CREATE PROCEDURE fill_genres ()
BEGIN
	DECLARE i INT DEFAULT 1;
	DECLARE amount INT DEFAULT 1;
	DECLARE `values` VARCHAR(255) DEFAULT choose_genre();
	WHILE i <= 1000 DO
		WHILE amount < CEIL(RAND() * 15) DO
			SET `values` = concat(`values`, ',', choose_genre());
			SET amount = amount + 1;
		END WHILE;
		UPDATE mangas SET genres = `values` WHERE id = i;
		SET `values` = choose_genre();
		SET amount = 1;
		SET i = i + 1;
	END WHILE;
END //

